css:
@-moz-document url-prefix("https://www.freepik.com/") {
body,.home-anon .popular-searches, .banner-registration, body.header--show #header, showcase__content,
html .scrollable, .detail__related>.container-fluid, .detail__related .showcase__content{
	background: #1e1e26 !important;}

.link--text, .link--text .icon,
h1, h2, h3, h4, h5, h6,
.button--border.button--outline,
.accordion--tabs .accordion__link:not(.nostyle){
	color: #bdbdbd}

.accordion--tabs .accordion__link:not(.nostyle).active, input{
	color: #03a9f4;
	border-bottom-color: #03a9f4;}



.home-anon .blog, .home-anon .collections__showcase, #header .group, .header-filter .row--title, #header, .detail__sidebar{
	background: #141414}

.post .post--inner, .button--border.button--outline:hover, .button--border.button--outline{
	box-shadow: 0 0 40px rgba(0, 0, 0, .4)}

.button--border.button--outline.active, .button--border.button--outline:active{
	}

#header{
	border-color: #000 !important}


.group:before{
	box-shadow: none}


.detail__sidebar,
.detail__group:after{
	border: none}

.tags li:not(.expandable__more){background: #4b4b4b;box-shadow: none}


.tags__item a, .tags__item button, .tags li a, .tags li button{
	color: #000; font-weight: 500}



#footer{box-shadow: 0 -1px 0 #404142}


*::-webkit-scrollbar {
    width: 10px !important;
    height: 10px !important;
    background: #1e1e1e !important;
    border: 1px solid #252525 !important;
}

::-webkit-scrollbar {
    width: 10px!important;
    height: 10px!important;
}

*::-webkit-scrollbar-button {
    display: none !important;
}

::-webkit-scrollbar-button {
    width: 0px!important;
    height: 0px!important;
}

*::-webkit-scrollbar-corner, *::-webkit-scrollbar-track {
    background: #1e1e1e !important;
}

::-webkit-scrollbar-corner {
    background: transparent!important;
}

*::-webkit-scrollbar-thumb {
    min-height: 28px !important;
    background: #333 !important;
}

*::-webkit-scrollbar-thumb, *::-webkit-scrollbar-track {
    border: 0 !important;
    box-shadow: none !important;
}
::-webkit-scrollbar-thumb {
    background: #4b4b4b!important;
    border: none!important;
    border-radius: 0px!important;
}

*::-webkit-scrollbar-corner, *::-webkit-scrollbar-track {
    background: #1e1e1e !important;
}
*::-webkit-scrollbar-thumb, *::-webkit-scrollbar-track {
    border: 0 !important;
    box-shadow: none !important;
}
::-webkit-scrollbar-track {
    background: #333333!important;
    border: none!important;
    border-radius: 0px!important;
}
}
